import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Nav from './Navigacja/Nav'

const theme = createMuiTheme({
  palette: {
      primary: {
          light: '#8d6e63',
          main: '#795548',
          dark: '#4e342e',
      },
      secondary: {
          light: '#eeeeee',
          main: '#9e9e9e',
          dark: '#424242',
      },
      info: {
          light: '#64b5f6',
          main: '#2196f3',
          dark: '#1565c0'
      },
      error: {
          light: '#e57373',
          main: '#f44336',
          dark: '#b71c1c'
      },
      success: {
          light: '#a5d6a7',
          main: '#4caf50',
          dark: '#2e7d32'
      },
      warning: {
          light: '#ffab40',
          main: '#ff9100',
          dark: '#ff6d00'
      },
  },
  typography: {
      fontFamily: [
          'Metamorphous',
          'Almendra',
          'Roboto',
      ].join(','),
  }
});

function App() {
  fetch('/offers.json')
  .then((r) => {return r.json() })
  .then (x => console.log(x))
  return (
    <> 
    <MuiThemeProvider theme={theme}>
    <Nav/>
    </MuiThemeProvider>

    </>

  );
}

export default App;
